INSERT INTO `wp_postmeta` VALUES (2896,230,'page_components_4_content_content','<h5>How we work</h5>\r\n<p><b>Focused. Considerate. Mindful.</b> Joining forces, operating cooperatively. We work on a project fee, consultancy or co-investment model. Values led with clarity, empathy and prosperity, combined with our 10 Commitments design approach is what makes us <b>‘We Not Me’.</b></p>');
